import "./footer.css";

function Footer() {
  return (
    <>
      <div className="Apps">
        <div className="header-divs">
          <footer className="footer">
            Coded by
            <a className="link" href="https://twitter.com/aminat_adenuga"> Corazon|DEV</a>.
          </footer>
        </div>
      </div>
    </>
  );
}
export default Footer;
